import React from 'react';
// //////////////////
import '../sass/pages/Advantages.styles.scss';
import img1 from '../img/header.jpg';
import img2 from '../img/header2.jpg';
import img3 from '../img/header3.jpg';
import FeautureAdvance from '../component/feautureAdvance.component';

const Advantages =() =>(
    <div className='advantages'>
        <h4 className='advantages__heading'>حامی کوک یک سامانه سفارش آنلاین غذاهای سنتی است که بهترین غذاها با کیفیت عالی به مشتریان عرضه میکند</h4>
        <FeautureAdvance img={img1} title='کیفیت غذا را تضمین میکند' text='در صورت عدم رضایت در اولین سفارش کل مبلغ پرداختی به حساب مشتری واریز میشود' />
    </div>
);

export default Advantages;
